import { decodeAiPicData, decodeAiPicHDData } from '.';

describe('decodeAiPicData', () => {
  test('basic usage', () => {
    const result = decodeAiPicData({
      str: '00f58c0300000188ffffff7504ff0000000000000240ffffffdc04ff0000000000000057ffffff7604ff00000000',
      mapScale: 1,
    });

    expect(result).toEqual([
      {
        accuracy: 255,
        id: 'pic_0',
        mapId: 62860,
        object: 4,
        position: {
          x: 39.2,
          y: 13.8,
        },
        reserved: 0,
        xHex: '00000188',
        yHex: 'ffffff75',
      },
      {
        accuracy: 255,
        id: 'pic_1',
        mapId: 62860,
        object: 4,
        position: {
          x: 57.6,
          y: 3.5,
        },
        reserved: 0,
        xHex: '00000240',
        yHex: 'ffffffdc',
      },
      {
        accuracy: 255,
        id: 'pic_2',
        mapId: 62860,
        object: 4,
        position: {
          x: 8.7,
          y: 13.7,
        },
        reserved: 0,
        xHex: '00000057',
        yHex: 'ffffff76',
      },
    ]);
  });
});

describe('decodeAiPicHDData', () => {
  test('basic usage', () => {
    const result = decodeAiPicHDData(
      ''
    );

    expect(result.source).toMatch(
      'data:image/png;base64,'
    );
  });
});
